values. For example:

```typescript
if (Checks.isArrayOf<string>(input, String)) {
  // It's safe to treat input as string[] in this block.
}
```

Use this library whenever you want to narrow down a type, either due to union types or due to
type inheritance.

Unlike [[Asserts]], this does not throw any errors on failure.

The general flow is to input an iterable, do a bunch of transformations, and output the
transformed iterable at the end. Note that the input iterable should never be used again. This
class does not make any guarantee that it will / will not modify the input iterable.

Example:

```typescript
Iterables
    .of(['a', 'b', 'c'])
    .forOf((value: string, breakFn: () => void) => {
      console.log(value);
    });
```

Note that every element in the iterable must be of the same type.

The general flow is to input a map, do a bunch of transformations, and output the transformed
map at the end. Note that the input map should never be used again. This class does not make any
guarantee that it will / will not modify the input map.

Example:

```typescript
let map = new Map<number, number>([[1, 2], [3, 4]]);
Maps
    .of(map)
    .forEach((value: number, key: number) => {
      console.log(value + key);
    });
```

Note that every key and value in the map must be of the same type.

To use this, just annotate the method whose return value you'd like to cache. You can clear the
cache by calling the [[clear]] method.

Example use case:

```typescript
import Cache from './a-cache';

let i = 0;

class TestClass {
  @Cache()
  get now(): number {
    i++;
    return i;
  }
}

let testClass = new TestClass();
testClass.now();  // 1
testClass.now();  // 1

// Clear the cache.
Cache.clear(testClass);
testClass.now();  // 2
```

You can also assign key identifiers to each cache call. This lets you to selectively clear a
group of cache values. For example:

```typescript
import Cache from './a-cache';

let i = 0;
let j = 0;

class TestClass {
  @Cache('i')
  get i(): number {
    i++;
    return i;
  }

  @Cache('j')
  get j(): number {
    j++;
    return j;
  }
}

let testClass = new TestClass();
testClass.i;  // 1
testClass.j;  // 1

// Clear the cache just for i.
Cache.clear(testClass, 'i');
testClass.i;  // 2
testClass.j;  // 1
```

This uses three different parts:

1.  [[Serializable]]: This annotates the class to be serializable. You will need to give the
    class a unique ID for serialization.
1.  [[Field]]: This annotates fields in the class as serializable. Like [[Serializable]], each
    field also needs an ID that uniquely identifies the field in the class. Note that the field
    has to be JSON serializable, or is annotated with [[Serializable]].
1.  [[Serializer]]: This class actually does the conversion from / to JSON.

Example class:

```typescript
// Ignore the \, there is something wrong with the doc parser.
\@Serializable('example')
class Example {
  @Field('fieldA') private fieldA_: number;
  @Field('fieldB') private fieldB_: string;

  constructor(a?: number, b?: string) {
    this.fieldA_ = a;
    this.fieldB_ = b;
  }
}

let example = new Example(1, 'b');
let json = Serializer.toJSON(example); // {_type: 'example', fieldA: 1, fieldB: 'b'}
Serializer.fromJSON(json); // This is the same as new Example(1, 'b');
```

Note that the class' constructor must be able to be called without any arguments.

Using this consists of 3 parts:

1.  First, you will need to bind the class that can be injected. Apply the `@Bind` annotation on
    the class.
1.  Next, on constructor parameters you want to do injection on, apply the `@Inject` annotation
    on the parameter.
1.  To instantiate a class, use the [[instantiate]] method. This will inject any parameters
    marked by the `@Inject` annotation with the bound value. Note that any classes injected this
    way must have all of its constructor parameters be `@Inject`d.

For example:

```typescript
import Bind from './inject/a-bind';
import Inject from './inject/a-inject';
import Injector from './inject/injector';

// Ignore the \. This is a bug with the typedoc parser.
\@Bind()
class Service {
  constructor() {}
}

class App {
  private service_: Service;

  constructor(@Inject() Service) {
    this.service_ = Service;
  }
}

let injector = new Injector();
let app = injector.instantiate(App);
```

By default, both `@Bind` and `@Inject` uses the class name and parameter name to determine the
binding key. However, you can override this behavior by specifying the names.

You can always inject the injector by using the `$gsInjector` binding key. This means either
using `@Inject()` on a parameter called `$gsInjector` or by using `@Inject('$gsInjector')`.

Any classes with `@Bind` are treated as singleton per instance of [[Injector]].

For example:

```typescript
import Jsons from './jsons';

Jsons.setValue(window, 'a.b.c', 123);
expect(window.a.b.c).toEqual(123);
```

Base use case is to start with the [[Http]] object, set all the parameters, and call [[send]].
The send will send the request and return a Promise. For example:

```typescript
import Http from './net/http';

Http.post('http://path')
    .setFormData({
      'cost': '$2',
      'food': 'ice cream'
    })
    .send()
    .then((response: string) => {
      // Do something with the response
    });
```

