This adds an in memory parameter. When navigating, you can set parameters that affect the URL
search parameters, or just the in memory parameter.

For example:

```typescript
import RouteService from './ng/route-service';

// Navigates to "/path?param1=value"
RouteService.to('/path', {'param1': 'value'}, {'param2': 'value'});

expect(RouteService.params).toEqual({
  'param1': 'value',
  'param2': 'value',  // You can still get this even though it is not in the URL
});
```

Each directory in `gs-tools` may contain special testing logic. Whenever you use them in your
project, you want to install the corresponding test setup file for tests in your project.

A recommended way to use this is to create a `test-base.ts` file in your project to set up the
`TestSetup` and include the `test-base` in every test. This `test-base` class should install the
test setup plugins to use, and call [[setup]] once during the test.

Example `test-base` file:

```typescript
import TestDispose from './testing/test-dispose';
import TestSetup from './testing/test-setup';

const testSetup = new TestSetup([TestDispose]);
let initialized = false;
export default = {
  setup() {
    if (!initialized) {
      testSetup.setup();
      initialized = true;
    }
  }
};
```

In your test:

```
import TestBase from './test-base';
TestBase.setup();

import DisposableClass from './disposable-class';
import TestDispose from './testing/test-dispose';

describe('Some disposable class', () => {
  it('should do something', () => {
    let disposableClass = new DisposableClass();

    // Without this, TestDispose will complain that disposableClass does not get disposed at the
    // end of the test.
    TestDispose.add(disposableClass);
  });
});
```

Using this consists of four steps:

1.  First, we need to identify the initiating window and the initiatee window.
1.  The initiator window identifies the initiatee window to send message to. It opens the channel
    using the [[open]] method.
1.  The initiatee window needs to know the origin of the initiating window, through some side
    channel or some preagreed value. It opens the channel using the [[listen]] method.
1.  Both the [[open]] and [[listen]] methods returns a Promise that will be resolved with the
    channel when the connection is open.

To close the channel, just dispose it.

For example, the initiating window can do:

```typescript
import PostMessageChannel './ui/post-message-channel';

PostMessagChannel
    .open(window, iframeEl.contentWindow)
    .then((channel: PostMessageChannel) => {
      channel.post({ 'message': 'blah' });
    });
```

The other window does:

```typescript
import PostMessageChannel './ui/post-message-channel';

PostMessageChannel
    .listen(window, 'http://expected.origin')
    .then((channel: PostMessageChannel) => {
      return channel.waitForMessage(() => true)
    })
    .then((data: gs.IJson) => {
      console.log(data.message);  // 'blah'
    });
```
